Content:
HempCoin(THC) is migrating to a  Komodo(KMD) Asset Chain.

The KMD migration will be 1:1 swap, migrating to OUR OWN asset chain with the availabilty to LOCK UP 50k & 100k THC secured by dPoW. Benefits of migration include upsteam update capabilities, (when KMD or ZEC update their chain with a feature THC needs), privacy secured by zk-Snarks is optional, & notary nodes as an option to add an extra layer of security and consensus. KMD's tech supports HempCoin(THC)'s interest in providing the agriculture, farming & tobacco industries with the tracking capability required to audit & track a whole crop from seed to sale. 

@Exile13
